"ERR_UNQ_BPR_DNYAKX_REL":"Droits d'acc\u00e8s","__COM_LANG_RESID":"Habitants","ins_infos_welcome":"Bienvenue sur la plan\u00e8te Trenqr. Ou Presque \u2026<br/><br/>Merci de remplir ce formulaire afin que nous puissions mieux faire connaissance.<br/>","ins_infos_welcome_more":'Cette courte \u00e9tape ne prend en moyenne que <b style="color: orange">3 minutes</b>.<br/> Pour chaque section, des informations seront disponibles dans cette fen\u00eatre afin de vous guider. <br/><br/> Si cela vous prend plus de 3 minutes, ne vous inqui\u00e9tez pas, \u00e7a restera entre nous !',
"ins_infos_fullname":"Votre nom de famille suivi de votre pr\u00e9nom. <br/>La combinaison ne doit pas d\u00e9passer <b>25 caract\u00e8res</b>.","ins_infos_fullname_more":"Sur Trenqr, c'est votre pseudo qui est mis en avant plan.<br/> Cependant, votre nom reste une information essentielle pour permettre aux autres utilisateurs de vous reconnaitre dans les recherches ou le flux d\u2019information.<br/><br/>Attention : Tout autre caract\u00e8re ajout\u00e9 n'\u00e9tant pas une <b>lettre</b> (a \u00e0 z) ou un <b>tiret</b> (-) rendra la section invalide.",
"ins_infos_borndate":"Votre date de naissance nous permet de d\u00e9terminer si vous avez l\u2019\u00e2ge l\u00e9gal pour utiliser nos services.","ins_infos_borndate_more":"Vous devez \u00eatre \u00e2g\u00e9 d\u2019au moins 12 ans au moment de l\u2019inscription.<br/><br/> Mais encore, votre \u00e2ge est un excellent indicateur pour nos statistiques qui influent fortement sur les services que nous vous offrons, la fa\u00e7on dont ils fonctionnent et comment les faire \u00e9voluer.","ins_infos_gender":"Fille ou gar\u00e7on ? Cette information nous permet d\u2019optimiser nos algorithmes et d'am\u00e9liorer notre qualit\u00e9 de service.",
"ins_infos_gender_more":"Si vous avez du mal \u00e0 choisir, vous pouvez s\u00e9lectionner le sexe auquel vous vous identifiez le mieux.<br/><br/> Toutefois, il faudrait garder \u00e0 l'esprit que ce choix peut, dans certains cas, avoir une grande importance.","ins_infos_city":"Il s'agit de votre ville de r\u00e9sidence principale.<br/> En cas de doute, vous pouvez vous aider des initiales du pays ou de la population de la ville.","ins_infos_city_more":"Si votre ville n'apparait pas, choisissez la plus grande ville \u00e0 approximit\u00e9 de chez vous.<br/><br/> Attention, les noms des villes sont soit dans la langue locale, soit en anglais. Par exemple, si vous vivez \u00e0 <q>Bruxelles</q> essayez <q>Brussels</q>.<br/><br/> Nos bases de donn\u00e9es sont r\u00e9guli\u00e8rement mises \u00e0 jour. Si votre ville n\u2019est pas disponible maintenant, elle pourrait l\u2019\u00eatre dans le futur. Patience, vous pourrez enfin indiquer la bonne ville.",
"ins_infos_pseudo":"Compos\u00e9 en majorit\u00e9 de caract\u00e8res alphanum\u00e9riques, votre pseudonyme vous suivra partout sur Trenqr. Pensez \u00e0 faire le bon choix.","ins_infos_pseudo_more":'Votre pseudonyme ne doit \u00eatre compos\u00e9 que de caract\u00e8res alphanum\u00e9riques <b>(a-z)</b> et du caract\u00e8re suivant : <b>_</b> <i>(barre de soulignement)</i>. L\u2019ensemble ne doit pas d\u00e9passer <b>20 caract\u00e8res</b>. <br/><br/>Trenqr utilise en priorit\u00e9 les pseudonymes. Nous vous conseillons donc d\u2019avoir un pseudonyme assez clair pour votre entourage. Pour nous \u00ab @toto \u00bb c\u2019est <b style="color: rgb(0,112,192)">coo<i>!</i></b> Mais pour vous retrouver parmi les centaines de \u00ab toto \u00bb possibles, il vous faudra \u00eatre tr\u00e8s populaire, actif ou chanceux. Sinon, vous risquez de vous sentir bien seul\u2026 <b style="color: rgb(249,35,35)">pas coo<i>!</i></b>',
"ins_infos_mail":"Il est n\u00e9cessaire que vous puissiez avoir pleinement acc\u00e8s \u00e0 cette adresse email car des informations confidentielles pourront y \u00eatre envoy\u00e9es.","ins_infos_mail_more":"Votre boite email constitue un des principaux outils qui puissent nous permettre de vous contacter hors des fronti\u00e8res de Trenqr. Aussi, assurez-vous qu\u2019il s\u2019agisse de votre adresse email principale et qu\u2019elle est fiable et s\u00e9curis\u00e9e.","ins_infos_mail_conf":"Confirmez votre email.",
"ins_infos_mail_conf_more":"","ins_infos_pwd":"Il s\u2019agit de l\u2019\u00e9l\u00e9ment cl\u00e9 dans la s\u00e9curisation de votre compte. Il est donc tr\u00e8s important de respecter les consignes sur la formation de votre mot de passe.","ins_infos_pwd_more":"Un mot de passe valide doit obligatoirement \u00eatre compos\u00e9 de la mani\u00e8re suivante : (1) <b>Au moins une lettre</b> (2) <b>Au moins un chiffre</b> (3) <b>Au moins un caract\u00e8re sp\u00e9cial</b> (4) <b>Le tout ayant au moins 6 caract\u00e8res</b>.<br/><br/>La s\u00e9curit\u00e9 est une de nos principales pr\u00e9occupations. Aujourd\u2019hui et dans le futur. Cependant, vous devez garder \u00e0 l\u2019esprit que votre participation est plus que requise. Dans le cas contraire, nos efforts resteront vains.",
"ins_infos_pwd_conf":"Confirmez votre mot de passe.","ins_infos_pwd_conf_more":"","ins_infos_pwd_notvl":"Invalide !","ins_infos_pwd_cdb":"Peut mieux faire !","ins_infos_pwd_notbd":"C'est pas mal !","ins_infos_pwd_good":"C'est Bien !","ins_infos_pwd_xclt":"All\u00e9luia, c'est excellent !","ins_err_multifield":"Plusieurs champs sont vides ou incorrects, veuillez les rev\u00e9rifier.<br/><br/> Cliquez sur un champ afin de voir l'erreur correspondante.<br/><br/>Si le champ est vide, vous serez sans doute invit\u00e9 \u00e0 r\u00e9essayer.",
"ins_err_void":"Le ou les champs indiqu\u00e9s ne peuvent rester vides.","ins_err_fn_uvbl":"Vous ne pouvez pas utiliser ce nom complet. Il contient des caract\u00e8res ou des mots non disponibles \u00e0 l'enregistrement.","ins_err_fn_chars":"Votre nom complet contient des caract\u00e8res invalides. Vous ne pouvez utiliser que des <b>lettres</b>(a-z), des <b>espaces</b>, des <b>traits d'union</b> (-) ou (+).","ins_err_fn_ln":"La longueur de votre nom complet d\u00e9passe les <b>25 caract\u00e8res autoris\u00e9s</b>.",
