"ins_err_eml_avlb":"Cette adresse email est <b>d\u00e9j\u00e0 utilis\u00e9e</b> par un autre compte.","ins_err_eml_dns":"Cette adresse email n'a pu \u00eatre valid\u00e9e car le domaine li\u00e9 ne r\u00e9pond pas \u00e0 nos requ\u00eates DNS.<br/><br/> En d'autres termes, soit le <b>domaine n'est pas actif</b>, soit <b>le serveur de messagerie est indisponible</b>.<br/><br/>Si cette erreur vous semble incoh\u00e9rente, nous vous recommandons de contacter votre fournisseur.","ins_err_eml_ban":"Le domaine li\u00e9 \u00e0 cette adresse email n'est pas accept\u00e9 sur Trenqr.<br/><br/> Nous vous conseillons donc de changer de fournisseur.<br/><br/> Il peut s'agir d'un soucis de <b>s\u00e9curit\u00e9</b>, <b>fiabilit\u00e9</b> ou de <b>qualit\u00e9 de service</b>.",
