"ins_err_pwd_thin":"Votre mot de passe doit comporter <b>au moins 6 caract\u00e8res</b> pour \u00eatre pris en compte.","ins_err_pwd_xtra_ltr":"Il manque <b>au moins une lettre</b> au mot de passe que vous avez saisi pour \u00eatre valide.","ins_err_pwd_xtra_spe":"Il manque <b>au moins un caract\u00e8re sp\u00e9cial</b> (exemple : + - < * \u00b2 ) au mot de passe que vous avez saisi pour \u00eatre valide.","ins_err_pwd_xtra_badspe":"Le caract\u00e8re sp\u00e9cial que vous avez saisi n'est pas pris en compte. Vous pouvez utiliser les caract\u00e8res suivants : <b>\u00b2 < > ! . ? + * - _ ~ \u00b5 \u00a3 ^ \u00a8 \u00b0 ( ) [ ] @ # $ %</b>",
"ins_err_pwd_xtra_dig":"Il manque <b>au moins un chiffre</b> au mot de passe que vous avez saisi pour \u00eatre valide.","ins_err_pwdcf_mnvoid":"Vous devez avant tout renseigner un mot de passe avant de vouloir le confirmer.","ins_err_pwdcf":"Le mot de passe de confirmation ne correspond pas \u00e0 celui renseign\u00e9 pr\u00e9c\u00e9demment.","ins_err_pwd+cf":"Votre mot de passe est incorrecte. Par la m\u00eame occasion, le mot de passe de confirmation ne correspond pas non plus.","ins_err_pwdcf_uxptd":"Une erreur inattendue est survenue. <br/><br/>L'adresse email rentr\u00e9e dans le champ de confirmation correspond au champ principal \u00e0 la diff\u00e9rence qu'il n'est pas valide quand le premier l'est.",
"ins_err_recall":"Pour votre s\u00e9curit\u00e9, les mots de passe doivent contenir au moins une lettre, un chiffre et un caract\u00e8re sp\u00e9cial.","ins_err_genderselect":"Veuillez s\u00e9lectionner votre genre (sexe). Vous pouvez vous aider de la section information.","ins_err_cgu":"Vous devez accepter nos conditions de service pour poursuivre l'inscription.","ins_err_notrbot":"Vous devez nous confirmer que vous n'\u00eates pas un robot en validant le captcha.","ins_err_pwpolicy":"Votre mot de passe ne respecte pas les contraintes. Veuillez vous r\u00e9f\u00e9rer \u00e0 la section information.",
"ins_err_forminvalid":"Le formulaire est invalide. Veuillez v\u00e9rifier vos informations avant de continuer.","ins_err_fnl_dzn_corrupt_fields":"Une erreur est survenue lors du traitement de l'op\u00e9ration.<br/>Le contr\u00f4le des champs a \u00e9chou\u00e9.","ins_err_final_badform":"<div><b>Un ou plusieurs champs ont \u00e9t\u00e9 jug\u00e9s invalides</b> par le serveur. Cette erreur peut provenir d'un disfonctionnement du moteur de validation local.</div><div><b>L'op\u00e9ration a donc \u00e9t\u00e9 annul\u00e9e</b>. Nous vous invitons \u00e0 r\u00e9essayer avec des donn\u00e9es diff\u00e9rentes de celles fournies pr\u00e9c\u00e9demment.</div><div>Si l'erreur persiste, veuillez nous le signaler.</div><div class='back'><a class='ins-fail-redo' href='/inscription'>Retourner au formulaire</a></div>",
"ins_err_final_badoper":"<div>Une <b>erreur fatale</b> est survenue lors de la cr\u00e9ation de votre compte. <b>L'op\u00e9ration a donc \u00e9t\u00e9 annul\u00e9e</b>. Nous en sommes d\u00e9sol\u00e9s !</div><div>Nous vous conseillons de r\u00e9essayer avec des donn\u00e9es diff\u00e9rentes de celles fournies pr\u00e9c\u00e9demment, surtout dans les cat\u00e9gories suivantes : <b>email</b>, <b>pseudo</b>.</div><div class='back'><a class='ins-fail-redo' href='/inscription'>Retourner au formulaire</a></div>",
"ins_err_final_seccaptch":"<div>Un <b>probl\u00e8me de s\u00e9curit\u00e9</b> a \u00e9t\u00e9 d\u00e9tect\u00e9 lors de la cr\u00e9ation de votre compte. Vous avez \u00e9chou\u00e9 \u00e0 l'\u00e9tape de confirmation de votre identit\u00e9 humaine. En effet, vous auriez d\u00fb valider le <b>captcha</b></div><div>S'il s'agit d'une erreur de notre part, veuillez nous le signaler.</div><div class='back'><a class='ins-fail-redo' href='/inscription'>Retourner au formulaire</a></div>","ins_err_final_secu":"Une <b>erreur fatale</b> est survenue lors de la cr\u00e9ation de votre compte. <b>L'op\u00e9ration a donc \u00e9t\u00e9 annul\u00e9e</b>. Nous en sommes d\u00e9sol\u00e9s !<br/><br/> Nous vous conseillons de r\u00e9essayer avec des donn\u00e9es diff\u00e9rentes de celles fournies pr\u00e9c\u00e9demment, surtout dans les cat\u00e9gories suivantes : <b>email</b>, <b>pseudo</b>.<br/><br/> <a class='ins-fail-redo' href='/inscription'>Retourner au formulaire</a>",
"ins_err_final_goodhdr":"OURAH, VOTRE COMPTE EST CR\u00c9\u00c9 !","ins_err_final_goown":"Aller vers votre compte","ins_hint_pwweak":"Votre mot de passe est faible. Vous devriez ajouter des caract\u00e8res.","ins_msg_welcome":"Bienvenue sur la page d'inscription de Trenqr!<br />Si jamais vous vous posez des questions sur un des \u00e9l\u00e9ments du formulaire, cette bulle d'aide pourra s\u00fbrement vous aider.","ins_msg_fullname":"Ici, vous devez renseigner votre nom complet (nom et pr\u00e9nom). Cela permettra aux autres utilisateurs de vous retrouver s'ils vous connaissent.",
"ins_msg_birthday":"Nous avons besoin de conna\u00eetre votre date de naissance afin de nous assurer que le contenu que nous vous proposerons sera adapt\u00e9.","ins_msg_gender":"Nous avons besoin de conna\u00eetre cette information afin que nous puissions vous repr\u00e9senter sur Trenqr avec le genre de votre choix.","ins_msg_city":"Nous vous demandons votre ville afin de conna\u00eetre approximativement votre lieu g\u00e9ographique, afin de vous proposer du contenu proche de chez vous d'une part, et \u00e9galement pour vous permettre de rechercher des utilisateurs ou des articles en fonction de leur ville.",
"ins_msg_pseudo":"C'est par le biais de ce pseudo que les autres utilisateurs pourront le plus facilement trouver votre contenu, car c'est votre pseudo que Trenqr va mettre en avant, plus que votre nom r\u00e9el.","ins_msg_email":"Veuillez utiliser une adresse email valide et dont vous n'avez pas perdu le mot de passe! C'est via cette adresse email que vous pourrez valider votre compte, ou r\u00e9initialiser votre mot de passe par exemple.","ins_msg_emailconf":"Veuillez utiliser une adresse email valide et dont vous n'avez pas perdu le mot de passe! C'est via cette adresse email que vous pourrez valider votre compte, ou r\u00e9initialiser votre mot de passe par exemple.",
"ins_msg_pw":"Choisissez votre mot de passe avec attention! Afin d'am\u00e9liorer la s\u00e9curit\u00e9, nous vous demandons d'utiliser un mot de passe d'au moins 6 caract\u00e8res, et contenant au moins une lettre, un chiffre et un caract\u00e8re sp\u00e9cial.","ins_msg_pwconf":"Choisissez votre mot de passe avec attention! Afin d'am\u00e9liorer la s\u00e9curit\u00e9, nous vous demandons d'utiliser un mot de passe d'au moins 6 caract\u00e8res, et contenant au moins une lettre, un chiffre et un caract\u00e8re sp\u00e9cial.",
